      ref: "",
      title: "First Sprint Challenge!",
      content: "I was given 3 hours to design 2 pages. Included were the design files, and some very disorganized html. I enjoyed this small challenge."
    },
  ];
  return (
    <section>
      {projects.map(e => (
        <Project project={e} />
      ))}
